readData.example:
```
function newLevel() {
    chatMessage('You still have ' + ModPE.readData('points'));
}
```
Reads the stored `points` value and posts it in the chat.

saveData.example:
```
function leaveGame() {
    ModPE.saveData('points', 500));
}
```
Sets the stored `points` value to `500` when the player leaves.
See [ModPE.readData](#ModPE.readData)

showTipMessage.example:
```
function useItem(x, y, z, id) {
	if (id == 46) { // 46 = TNT
		if (Level.getTile(x, y - 1, z) == 19) { // 19 = sponge
			preventDefault();
			ModPE.showTipMessage("You can't place TNT above sponge!");
		}
	}
}
```
This will cancel the action and show a tip message, warning the user that they can't place TNT above a sponge block.

