redstoneUpdateHook.example:
```
function redstoneUpdateHook(x, y, z, signalStrength, worldLoading, blockId, blockData) {
	if (blockId == 35) { // 35 = wool
		if (!worldLoading && signalStrength > 0) { // make sure it's a 'power on' event
			blockData = blockData >= 15: 0 ? blockData + 1; // we want to reset the data value to 0 if it's already the highest, otherwise add 1;
			Level.setTile(x, y, z, blockId, blockData);
		}
	}
}
```
This example increases the data value of a wool block when it's powered by redstone. If it's already black (the highest data value, 15), then it's resetted to white.
If you use a clock, you'll have disco wool.

procCmd.example:
```
function procCmd(command) {
	var cmd = command.split(' ');
	if (cmd[0].toLowerCase() == 'coords') {
		ModPE.showTipMessage(Player.getX() + '/' + Player.getY() + '/' + Player.getZ());
	}
}
```
It is recommended to split `command` into an array, so you can individually access each argument.
If arguments are required, then `command` will equal `"tp 500 128 30"`. Once split by spaces, you can access `"tp"` with `cmd[0]`, `"500"` with `cmd[1]`, etc...
